(weekday) %>% \n","  ggplot(mapping = aes(x=weekday, y=num_of_rides, fill=customer_type))+\n","  geom_bar(stat = \"identity\", position = \"dodge\")+\n","  scale_fill_manual(values = c(\"orange\", \"darkblue\"))+\n","  labs(x = \"Day of Week\",\n","       y = \"Number of Trips\", \n","       title = \"Total Trips per Day By Customer Type\",\n","       fill = \"Customer Type\")+\n","  theme(plot.title =element_text(family = \"serif\", color = \"darkred\", size = 18, face=\"bold\", hjust=0.5),\n","        axis.title.x = element_text(face=\"bold\", size = 12),\n","        axis.text.x  = element_text(face = \"bold\", size = 10),\n","        axis.title.y = element_text(face = \"bold\", size = 12),\n","        axis.text.y = element_text(face = \"bold\", size = 10),\n","        legend.title = element_text(face = \"bold\", size = 12),\n","        legend.text = element_text(face = \"bold\", size = 10))+\n","  scale_y_continuous(labels = function(y)format(y, scientific=FALSE))"]},{"cell_type":"markdown","id":"02e072f8","metadata":{"papermill":{"duration":0.228921,"end_time":"2022-03-06T19:37:44.885518","exception":false,"start_time":"2022-03-06T19:37:44.656597","status":"completed"},"tags":[]},"source":["From the bar graph above, we can observe that casual riders are highly active on weekends because it is obvious that casual riders mostly use bike-sharing service for leisure and tourism purposes. It is interesting to note that the distribution of the number of trips among the annual members is more or less consistent over the entire but slightly goes down on weekends. This indicates members mainly use the bike-sharing services to commute work."]},{"cell_type":"markdown","id":"1ec0510c","metadata":{"papermill":{"duration":0.225316,"end_time":"2022-03-06T19:37:45.338756","exception":false,"start_time":"2022-03-06T19:37:45.11344","status":"completed"},"tags":[]},"source":["**2. Creating visualization for average trip duration each day by rider type**"]},{"cell_type":"code","exe