pq3axHgAAAABJRU5ErkJggg=="},"metadata":{"image/png":{"height":480,"width":720}},"output_type":"display_data"}],"source":["options(repr.plot.width = 12, repr.plot.height = 8)\n","tripdata %>% group_by(customer_type, weekday) %>% \n","  summarize(min_ride = min(ride_length, na.rm = TRUE),\n","            max_ride = max(ride_length, na.rm = TRUE),\n","            mid_ride = median(ride_length, na.rm = TRUE),\n","            avg_ride = mean(ride_length, na.rm = TRUE),\n","            num_of_rides = n(),\n","            total_ride = sum(ride_length, na.rm = TRUE)) %>% \n","  arrange(weekday) %>% \n","  ggplot(mapping = aes(x=weekday, y=avg_ride, fill=customer_type))+\n","  geom_bar(stat = \"identity\", position = \"dodge\")+\n","  scale_fill_manual(values = c(\"orange\", \"darkblue\"))+\n","  labs(x = \"Day of Week\",\n","       y = \"Average Trip Duration\", \n","       title = \"Average Trip Duration per Day By Customer Type\",\n","       fill = \"Customer Type\")+\n","   theme(plot.title =element_text(family = \"serif\", color = \"darkred\", size = 18, face=\"bold\", hjust=0.5),\n","         axis.title.x = element_text(face=\"bold\", size = 12),\n","         axis.text.x  = element_text(face = \"bold\", size = 10),\n","         axis.title.y = element_text(face = \"bold\", size = 12),\n","         axis.text.y = element_text(face = \"bold\", size = 10),\n","         legend.title = element_text(face = \"bold\", size = 12),\n","         legend.text = element_text(face = \"bold\", size = 10))+\n","  scale_y_continuous(labels = function(y)format(y, scientific=FALSE))"]},{"cell_type":"markdown","id":"a3064059","metadata":{"papermill":{"duration":0.265217,"end_time":"2022-03-06T19:37:47.117701","exception":false,"start_time":"2022-03-06T19:37:46.852484","status":"completed"},"tags":[]},"source":["The bar graph above shows that the average trip duration of casual riders over the entire week is considerably longer than or more than twice that of the annual members, and takes a high peak on weekends. The distribution of the average trip duration for the members is consistent irrespective of the day of week."]},{"cell_type":"markdown","id":"bf6ea41f","metadata":{"papermill":{"duration":0.230237,"end_time":"2022-03-06T19:37:47.578978","exception":false,"start_time":"2022-03-06T19:37:47.348741","status":"completed"},"tags":[]},"source":["**3. Creating visualization for the number of rides each month by rider type**"]},{"cell_type":"code","execution_count":30,"id":"f1b800b1","metadata":{"execution":{"iopub.execute_input":"2022-03-06T19:37:48.046695Z","iopub.status.busy":"2022-03-06T19:37:48.044894Z","iopub.status.idle":"2022-03-06T19:37:49.225967Z","shell.execute_reply":"2022-03-06T19:37:49.225324Z"},"papermill":{"duration":1.415903,"end_time":"2022-03-06T19:37:49.226113","exception":false,"start_time":"2022-03-06T19:37:47.81021","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["`summarise()` has grouped output by 'customer_type'. You can override using the `.groups` argument.\n","\n"]},{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAABaAAAAPACAIAAABM5kn/AAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd5hU1f0H4DM7W4FdOogUASliQ7F3bBGxxK7BrhiT2LsmxhZbTPzZNcGGLRoV\nC6JoROwVuxhRFAWk97K9zO+PXXaXhV12YdnZa9734Xm4c++U75w5Mzv3M/ecG0skEgEAAAAg\nylKSXQAAAADAuhJwAAAAAJEn4AAAAAAiT8ABAAAARJ6AAwAAAIg8AQcAAAAQeQIOAAAAIPIE\nHAAAAEDkpSa7AOB/zlu/uW+PJxY39FbXTjv7T93T1+Vx82bMnfB9YflyPCN71x3brMu9hRDa\npd28qCRRvjxs0pmP9c+s7ZpN8JTrXwy1icX+XmNNakZ2Xv7pabGa15z9/uguO39XY2WnrQ6d\n89nG66+8utXdvRu9e3x+9SNbXzWntq2xlHh264wuvdrttFvP4WdsvUvfjHV8uAb58vXJz47+\n4ZU3Z/88O3fe/KLsji27dGk5cJdehx3W98DdO6au8mo2sUb/IIq6ZP1FAOAXScAB/K/48elX\nB587q3y51YZbL5uxd3LrofkrKVz28NziUzun1Vg/+Z55SamnDs2qeyfKSpcuylu6KO/bT39+\n+M4PT7r2oPsv7d0Ejzv/4+/OPPeNf7+7tPrKgplL581c+uUnsx65/b2OW/S67b79f7N9iyYo\npjbN6pUCgF8YQ1QAoFaPvZW36spR43ObvpKIKistfuCyZ468fb1HQt88/W7fnV6okW7UMO+r\nH4/decT5D89f38UAAEnhCA6gqbXs3m7zzWt++EybtGDpikPo4+ktB/TLqnGFDquOE4iOJnjK\nAzbvUHlv3dIj3FbNzbd3zA1