, na.rm = TRUE),\n","            avg_ride=mean(ride_length, na.rm = TRUE),\n","            num_of_rides = n(),\n","            total_ride=sum(ride_length, na.rm = TRUE)) %>% \n","  arrange(month) %>% \n","  ggplot(mapping = aes(x=month, y=avg_ride, fill=customer_type))+\n","  geom_bar(stat = \"identity\", position = \"dodge\")+\n","  scale_fill_manual(values = c(\"darkred\", \"darkgreen\"))+\n","  labs(x = \"Month\",\n","       y = \"Average Trip Duration\", \n","       title = \"Average Trip Duration per Month By Customer Type\",\n","       fill = \"Customer Type\")+\n","  theme(plot.title =element_text(family = \"serif\", color = \"darkblue\", size = 18, face=\"bold\", hjust=0.5),\n","        axis.title.x = element_text(face=\"bold\", size = 12),\n","        axis.text.x  = element_text(face = \"bold\", size = 10, angle = 45),\n","        axis.title.y = element_text(face = \"bold\", size = 12),\n","        axis.text.y = element_text(face = \"bold\", size = 10),\n","        legend.title = element_text(face = \"bold\", size = 12),\n","        legend.text = element_text(face = \"bold\", size = 10))+\n","  scale_y_continuous(labels = function(y)format(y, scientific=FALSE))"]},{"cell_type":"markdown","id":"335a5afd","metadata":{"papermill":{"duration":0.240832,"end_time":"2022-03-06T19:37:51.911691","exception":false,"start_time":"2022-03-06T19:37:51.670859","status":"completed"},"tags":[]},"source":["The graph above shows that the average trip duration made by casual riders is still considerably longer than those of the annual members throughout the year."]},{"cell_type":"markdown","id":"203d5e97","metadata":{"papermill":{"duration":0.237759,"end_time":"2022-03-06T19:37:52.389732","exception":false,"start_time":"2022-03-06T19:37:52.151973","status":"completed"},"tags":[]},"source":["**5. Creating visualization for bike demand throughout the day**"]},{"cell_type":"code","execution_count":32,"id":"ed9a514e","metadata":{"execution":{"iopub.execute_input":"2022-03-06T19:37